#include <iostream>
#include <vector>
#include <algorithm>
#include <map>

#define en '\n'
#define bg(x) begin(x)
#define all(x) bg(x), end(x)
#define fin(x) for (auto &it : x) cin >> it

using namespace std;

using ll = long long;
using i32 = int32_t;

template<typename T>
using V = vector<T>;
using vi = V<int>;

i32 main()
{
    ios_base::sync_with_stdio(false); cin.tie(nullptr); cout.tie(nullptr);

    int n; cin >> n;
    vi a(n); fin(a);
    sort(all(a));
    int ans = 0;
    map<int, int> cnt;
    for (size_t i = 0; i < n; i++)
    {
        cnt[a[i]]++;
    }
    auto it = cnt.begin();
    int pred = a[0] - 1;;
    int del = 0;
    bool can = true;
    while (it != cnt.end()) {
        int tek = it->first;
        int limit = 1;

        if (tek - pred > 1) {
            can = true;
        }

        if (can)
            limit = 2;

        del = min(it->second, limit);
        ans += del;

        if (del == 2)
            can = false;

        pred = it->first;
        it++;

    }
    cout << ans << en;
}
